
DROP TABLE IF EXISTS fake_customer;
 
CREATE TABLE IF NOT EXISTS fake_customer (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `first_name` varchar(255) default NULL,
  `last_name` varchar(255) default NULL,
  `birth_place` varchar(50) default NULL,
  `birth_date` varchar(50) default NULL,
  `address` varchar(255) default NULL,
  `zip` varchar(255) default NULL,
  `city` varchar(50) default NULL,
  `province` varchar(50) default NULL,
  `contact1` varchar(100) default NULL,
  `contact2` varchar(100) default NULL,
  `fiscal_code` varchar(255) default NULL,
  `email` varchar(255) default NULL,
  `vat` varchar(255) default NULL,
  PRIMARY KEY (`id`)
);



  
DROP TABLE IF EXISTS fake_vector;

CREATE TABLE fake_vector (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `name` varchar(255) default NULL,
  `owner` MEDIUMINT default NULL,
  `type` varchar(50) default NULL,
  `builder` varchar(255) default NULL,
  `model` varchar(255) default NULL,
  `length` varchar(50) default NULL,
  `width` varchar(50) default NULL,
  `engine` varchar(255) default NULL,
  `plate` varchar(255) default NULL,
  `insurance_company` varchar(255) default NULL,
  `insurance_id` varchar(255) default NULL,
  `insurance_expire` varchar(50) default NULL,
  PRIMARY KEY (`id`)
);





